import { createContext } from "react";

export const ModalContext = createContext({
  isShow: false,
  setIsShow: () => {},
});

export const ModalDelegateContext = createContext({
  isShowModalDelegate: false,
  isShowModalUndelegate: false,
  setIsShowModalDelegate: () => {},
  setIsShowModalUndelegate: () => {},
});
